target:
h1{
     color:gray;
} The element is the h1 which stands for header 1
I also changed this at times

p{
     color:gray;
}

Which changes ALL paragraph elements on that page

p = paragraph
h# = header #
So on so forth You can also do .something as an element

Basically . tells the web page that its an abnormal element with a specific id that's followed by the . Ex:
.wood{
     font-size:30px;
     color:magenta;
}

This changes items with the specified class of "wood" to font size 30 with the color as magenta
